import React, { useState } from "react";

function TopNavItem(props) {

    const [isMouseOver, setMouseOver] = useState("false");

    function handleMouseOver() {
        setMouseOver(true);
    }

    function handleMouseLeave() {
        setMouseOver(false);
    }

    return <a onMouseOver={handleMouseOver} onMouseLeave={handleMouseLeave} id={props.title} href={props.href}><div style={{ borderBottom: isMouseOver ? "3px solid transparent" : "3px solid #7718aa" }} className="topBarText">{props.title}</div></a>;
}

export default TopNavItem;
